import React from "react";
import s from "../App.module.css";


const BtnDisplayComponent = (props) => {
    return (
        <div>
            <button className={s.stopwatch_btn + s.stopwatch_btn_gre}></button>
        </div>
    );
}

export default BtnDisplayComponent;
